import React from 'react';
import Trump from '../../assets/three.png';

const Navbar = () => {
  return (
    <div className='navbar'>
      <img
        src={Trump}
        style={{ height: '15rem', margin: '0px', padding: '0px' }}
      />
    </div>
  );
};

export default Navbar;
